import React, {useState} from 'react';
import {headerData} from '../../data';
import { NavLink, Link } from "react-router-dom";

const Nav = () => {
    const [headers, setHeaders] = useState(headerData);
    //console.log("data is" + JSON.stringify(headers));
    return (
        <nav className="container">
            <ul>
                {
                    headers.map((header) => {
                        const {id, value, link} = header
                        console.log(value);
                        return (
                            <NavLink activeClassName="active" to={link}>
                                <li key={id}>{value}</li>
                            </NavLink>
                        )
                    })
                }
            </ul>
        </nav>
    )
}

export default Nav
